#define STDOUT 0xd0580000

.section .text
.global _start
_start:
    
la s1, board
la s5, transposed

li s2, 64 #size
li s3, 1 #for boolean check

jal convertToTranspose
jal solveBoard
j exit

solveBoard:
    addi sp, sp, -24
    sw s6, 20(sp)
    sw s4, 16(sp)
    sw a3, 12(sp)# number jo ham try krenge
    sw a2, 8(sp) # col
    sw a1, 4(sp) #row
    sw ra, 0(sp)
    jal saveTempRegisters

    li a1, 0 #rows
    #mul t0, s2, s2 
    
    outer:
        bge a1, s2, solved # a1=0
	    mul t3, a1, s2
        add t3, s1, t3# correct row agayi of board
		
		 li a2, 0 #cols
		
        inner:
            bge a2, s2, innerEnd
            add s4, t3, a2 #correct column agaya jaha insert krna aik aik krke choose horha
            lb t4, 0(s4)
			
            beqz t4, anotherLoop
            addi a2, a2, 1
            j inner
			
            anotherLoop: #try every numbers to place in that position
                li a3, 1 #1 se 64 try numbers try
                looop: #for inserting the correct number at the row a1 col a2 position
                    bgt a3, s2, reject
                    jal isSafe #if safe so a0=1 if not safe so a0=0
					
                    bne a0, s3, nope #if not equal means a0=0 and s3=1 so go to nope and try another number increment a3 basically
					
					mul t3, a2, s2 #storing in the transpose matrix since aage we will have to place checks in column so sath sath transpose mem bhe dal do but ulta krke
					add t3, t3, a1
					add s6, t3, s5
					sb a3, 0(s6) #transpose me store karaya
					
                    sb a3, 0(s4) #storing in the original board
                    jal solveBoard
					
					
					
                    beq a0, s3, solved 
                    sb zero, 0(s4)
		            sb zero, 0(s6)
			
			
					
                    nope: #means not safe to place number a3 in board now check a3+1 e.g 2 3 4 ...till 64
                        addi a3, a3, 1
                        j looop
						
						
                reject:
                    jal restoreTempRegisters #restore all registers
                    lw ra, 0(sp)
                    lw a1, 4(sp)
                    lw a2, 8(sp)
                    lw a3, 12(sp)
                    lw s4, 16(sp)
					lw s6, 20(sp)
                    addi sp, sp, 24
                    li a0, 0
                    jr ra
        innerEnd:
            addi a1, a1, 1 
            j outer
    solved:
        jal restoreTempRegisters
        lw ra, 0(sp)
        lw a1, 4(sp)
        lw a2, 8(sp)
        lw a3, 12(sp)
        lw s4, 16(sp)
	    lw s6, 20(sp)
        addi sp, sp, 24
        li a0, 1
        jr ra

isSafe:
    addi sp, sp, -8
    sw s4, 4(sp)
    sw ra, 0(sp) 
    jal saveTempRegisters # t0-t6 apne kaam keleye istemal kr rha

    
    #Intialize Vector Registers and vector length
    addi a4, zero, 32 #using magic number "64" as size (there is a reason that i am not using s2 reg)
    vsetvli t0, a4, e8, m1 #32 elements in 1 vector
	
	
	
    
    #Row check with vector registers
    mul t1, a1, s2
    add t1, s1, t1 #row plus base address t1 has start of row ka address jis row me number insert krna hai
    vle8.v v0, (t1) #first 32 elements of the row in v0
    vmseq.vx v1, v0, a3 #compares each element in v0 with a3 jaha barabar waha 1 wrna 0 so v1 has 32 elements 0's 1's se bhara va
    vpopc.m t2, v1 #counts no. of 1's in v1 and stores scalar value in t2
    bnez t2, notSafe # if  t2=0 means row is safe but if t2 not equal to zero so not safe to place no go to notSafe
    
    addi t1,t1,32 #check next 32 elements same procedure
    vle8.v v0, (t1) #next 32 elements of the row in v0
    vmseq.vx v1, v0, a3
    vpopc.m t2, v1   
    bnez t2, notSafe
    
    
    
    
    #Col Check with vector registers
    mul t1, a2, s2 #for transposed board col becomes row
    add t1, s5, t1 #getting row from transposed board row in transpose=col in board
    vle8.v v0, (t1) #first 32 elements of the row in s5 transpose matrix
    vmseq.vx v1, v0, a3
    vpopc.m t2, v1
    bnez t2, notSafe
    
    addi t1,t1,32
    vle8.v v0, (t1) #first 4 elements of the row in v0
    vmseq.vx v1, v0, a3
    vpopc.m t2, v1
    bnez t2, notSafe
    
    
    
    #BOX CHECK STARTS HERE
 
    addi a4, zero, 8
    vsetvli t0, a4, e8, m1 #now vector will have 8 elements each of size 8 bits/ 1byte
	
	
    addi t1, zero, 8 #the value 8 refers to (squareRoot(SIZE)) size=64
    
    rem t2, a1, t1 #a1=row t1=8 t2=row %8
    sub t2, a1, t2 # #a1=row so t2= row - row % 8
	
    
    rem t5,a2,t1 #t5 = a2 % t1 --> col & 8
    sub t5,a2,t5 #t5 = col - col % 8
	
	addi t3, zero, 0 #index for loop i samjh lo
    
    boxCheckLoop:
    	    bge t3, t1, safe #loop runs 8 times checks 8 rows 0 se 7
    	    add t2, t2, t3 # row + t3(0,1,2,3,4,5,6,7)
			mul t2, s2, t2 # row x 64//// ***
			add t2, t2, t5# row + col=t2
			add t2, s1, t2#finally add t1 with board base to get starting of subgrid
			vle8.v v3, (t2) #8 elements of subgrid row in v3
			vmseq.vx v4, v3, a3 #baqi checks same
			vpopc.m t4, v4
			bnez t4, notSafe
			addi t3, t3, 1
			rem t2, a1, t1 
    	    sub t2, a1, t2 #reset t2 at starting of subgrid nextloop me it adds with 1(t3) and then multiplies by 64 to go to correct row st and then add with col to be at 2nd row of subgrid
			j boxCheckLoop	    
    
          
    notSafe:
        li a0, 0
        jal restoreTempRegisters
        lw ra, 0(sp)
        lw s4, 4(sp)
        addi sp, sp, 8
        jr ra
    safe:
        li a0, 1
        jal restoreTempRegisters
        lw ra, 0(sp)
        lw s4, 4(sp)
        addi sp, sp, 8
        jr ra

saveTempRegisters:
    addi sp, sp, -28
    sw t6, 24(sp)
    sw t5, 20(sp)
    sw t4, 16(sp)
    sw t3, 12(sp)
    sw t2, 8(sp)
    sw t1, 4(sp)
    sw t0, 0(sp)    
    jr ra

restoreTempRegisters:
    lw t0, 0(sp)
    lw t1, 4(sp)
    lw t2, 8(sp)
    lw t3, 12(sp)
    lw t4, 16(sp)
    lw t5, 20(sp)
    lw t6, 24(sp)
    addi sp, sp, 28
    jr ra
    
convertToTranspose:
      
    li t2, 0           # t2 = row index

	outer_loop:
	    beq t2, s2, end_outer_loop  # If t2 == 4, exit the outer loop  s2=64 row control

	    li t3, 0           # t3 = column index

	inner_loop:
	    beq t3, s2, end_inner_loop  # If t3 == 4, exit the inner loop columns control

	    # Calculate source index: t2 * 4 + t3
	    mul t4, t2, s2     # t4 = t2 * 4
	    add t4, t4, t3     # t4 = t4 + t3
	    add t4, s1, t4 #board ke correct pos.
	    
	    # Load byte from board[t4]
	    lb t5, 0(t4)       # t5 = board[t4]

	    # Calculate destination index: t3 * 4 + t2  this is for transpose
	    mul t6, t3, s2     # t6 = t3 * 4
	    add t6, t6, t2     # t6 = t6 + t2
	    add t6, s5, t6

	    # Store byte in transpose[t6]
	    sb t5, 0(t6)       # transpose[t6] = t5
	    
	    addi t3, t3, 1     # t3++ col=col +1
	    j inner_loop       # Repeat inner loop

	end_inner_loop:
	    addi t2, t2, 1     # t2++ row=row+1
	    j outer_loop       # Repeat outer loop

	end_outer_loop:
		jr ra    

exit:
	  addi t0, zero, 0
	  mul t1, s2, s2
	  
	  loop:
	  	beq t0, t1, exit2
	  	add t2, s1, t0
	  	lb t3, 0(t2)
	  	addi t0, t0, 1
	  	j loop
	  exit2:
	  
	  
	    
    # Finish section
    
_finish:
    li x3, 0xd0580000
    addi x5, x0, 0xff
    sb x5, 0(x3)
    beq x0, x0, _finish
.rept 100
    nop
.endr

